import React, { useContext, useEffect } from "react";
import { EllipsisOutlined } from "@ant-design/icons";
import { Switch } from "antd";
import "./nav.scss";
import { useMediaQuery } from "react-responsive";
import { panelStateContext } from "../../contexts/panelState";
export default function Navigation() {
  const isMobile = useMediaQuery({ query: `(min-width: 780px)` });
  const [toggleActiveMode, settActiveMode] = React.useState(false);
  const { panelState, setPanelState } = useContext(panelStateContext);
  const handlePanelState = () => {
    setPanelState(!panelState);
  };
  useEffect(() => {
    // alert(panelState);
  }, []);
  return (
    <div id="nav">
      {!isMobile ? (
        <EllipsisOutlined
          style={{ fontSize: "36px" }}
          onClick={handlePanelState}
        />
      ) : (
        <p>Navigation</p>
      )}
      <Switch
        checked={toggleActiveMode}
        checkedChildren={isMobile ? "Filter Mode On" : ""}
        unCheckedChildren={isMobile ? "Filter Mode Off" : ""}
        size={isMobile ? "" : "small"}
        onChange={() => {
          settActiveMode(!toggleActiveMode);
        }}
      />
      <div className="profile"></div>
    </div>
  );
}
